import { useState, useEffect } from 'react';
import './App.css';

const App =  (props) => {
  const [counter, setCounter] = useState(0);

  useEffect(()=>{
    setCounter(100)
  })

  return (
    <div className="App"> 
    {/* Hook */}
      <button onClick={() => setCounter((prevCount) => prevCount -1)}>-</button>
      <h1>{counter}</h1>
      <button onClick={() => setCounter((prevCount) => prevCount +1)}>+</button>

    </div>
  );
}

export default App;
